-- This script only contains the table creation statements and does not fully represent the table in the database. Do not use it as a backup.

-- Sequence and defined type
CREATE SEQUENCE IF NOT EXISTS place_bets_id_seq;

-- Table Definition
CREATE TABLE "public"."place_bets" (
    "id" int8 NOT NULL DEFAULT nextval('place_bets_id_seq'::regclass),
    "member_account" varchar(255) NOT NULL,
    "player_id" int8,
    "player_agent_id" int8,
    "product_code" int8 NOT NULL,
    "provider_name" varchar(255),
    "game_type" varchar(255) NOT NULL,
    "operator_code" varchar(255) NOT NULL,
    "request_time" timestamp(0),
    "sign" varchar(255) NOT NULL,
    "currency" varchar(255) NOT NULL,
    "transaction_id" varchar(255) NOT NULL,
    "action" varchar(255) NOT NULL,
    "amount" numeric(20,4) NOT NULL,
    "valid_bet_amount" numeric(20,4),
    "bet_amount" numeric(20,4),
    "prize_amount" numeric(20,4),
    "tip_amount" numeric(20,4),
    "wager_code" varchar(255),
    "wager_status" varchar(255),
    "round_id" varchar(255),
    "payload" json,
    "settle_at" timestamp(0),
    "game_code" varchar(255),
    "game_name" varchar(255),
    "channel_code" varchar(255),
    "status" varchar(255) NOT NULL DEFAULT 'pending'::character varying,
    "before_balance" numeric(20,4),
    "balance" numeric(20,4),
    "created_at" timestamp(0),
    "updated_at" timestamp(0),
    PRIMARY KEY ("id")
);


-- Indices
CREATE UNIQUE INDEX place_bets_transaction_id_unique ON public.place_bets USING btree (transaction_id);

